import React from "react";
import Link from "next/link";
import Router from "next/router";
const indexPage = () => {
	return (
		<div>
			<h1>Main page</h1>
			<p>
				Navigate to{" "}
				<Link href="/auth">
					<a>Auth</a>
				</Link>
			</p>
			<button onClick={() => Router.push("/auth")}>Auth page</button>
		</div>
	);
};

export default indexPage;
